import React from 'react';

function TodoItem({todo}) {
  const todoItemStyle = {
    background: '#ccc',
    padding: '5px 5px',
    width: '100%',
    borderBottom: '1px dotted #fff'
  };
  const todoTextStye = {
    fontSize: '4rem'
  }
  return (
    <div className='' style={todoItemStyle}>
      <div className={todoTextStye}>{todo.text}</div>
    </div>
  )
}

export default TodoItem;
